import React from 'react';
import PropTypes from 'prop-types';
import './AppBar.css' //para manejar su css
import TimeBar from "TimeBar";

AppBar.propTypes = { //los props deben aceptar solo estos tipos 
    title: PropTypes.string, 
    subtitle: PropTypes.string
};

function AppBar({title="TITULO", subtitle="Subtitle",time, ...props}) { //...props: que jale todos los props que tienen los componentes por default (los va a tener disponibles pero no guardados)
    //si no le mandamos los parametros, que utilice los que tiene por default
        
    return (
        <div className="appbar">
            <h1> {title} </h1>
            <h4>{subtitle} </h4>
            <h4 className="time"> {time} </h4>
            </div>    
    );
}

export default AppBar;
